let currentVideo = null; // 現在表示されている動画データを保持

// ボタンAを押すとランダムでサムネイル表示
document.getElementById("buttonA").addEventListener("click", () => {

  // `historyText()` で履歴を更新
  //historyText();

  // ランダムに動画を選択
  currentVideo = videos[Math.floor(Math.random() * videos.length)];

  // サムネイルURLを生成
  const thumbnailUrl = `https://img.youtube.com/vi/${currentVideo.videoId}/maxresdefault.jpg`;

  // サムネイル画像を表示
  document.getElementById("thumbnail").src = thumbnailUrl;

  // タイトルの領域は確保したまま、表示を非表示にする
  document.getElementById("title").style.visibility = "hidden";
  // フォームをクリア
  clearText();
});

// ボタンBを押すと現在表示されているサムネイルのタイトルを表示
document.getElementById("buttonB").addEventListener("click", () => {
  
  count_up()
  historyText()

  if (currentVideo) {
    // タイトルを表示
    document.getElementById("title").innerText = `${currentVideo.title}`;
    document.getElementById("title").style.visibility = "visible";
  } else {
    alert("サムネイルが表示されていません");
  }
});

